INSERT INTO `v1_5d01802fa390e445fe1d6f48ca614dd096e6b012cf502c1259d5b9295d15a842` VALUES (2, 1, "vo_minigame_1013_icon_2_002_001", 2, "訓練はまだ\nここからですわ", 2, "vo_minigame_1013_icon_1_002_001", 3000, 1000, "調子が上がって\nきたなっ");
INSERT INTO `v1_5d01802fa390e445fe1d6f48ca614dd096e6b012cf502c1259d5b9295d15a842` VALUES (2, 2, "vo_minigame_1013_icon_2_003_001", 2, "クスクス、悪くない\n流れですわね", 2, "vo_minigame_1013_icon_1_003_001", 3000, 5000, "ほらほら、\nまだいけるだろ？");
INSERT INTO `v1_5d01802fa390e445fe1d6f48ca614dd096e6b012cf502c1259d5b9295d15a842` VALUES (3, 3, "vo_minigame_1013_icon_2_004_001", 2, "すばらしい\n記録ですわ", 2, "vo_minigame_1013_icon_1_004_001", 3000, 10000, "へへっ、おまえら\nやるじゃねえか！");
INSERT INTO `v1_5d01802fa390e445fe1d6f48ca614dd096e6b012cf502c1259d5b9295d15a842` VALUES (3, 4, "vo_minigame_1013_icon_2_005_001", 3, "乗りに乗って\nいますわね", 2, "vo_minigame_1013_icon_1_005_001", 3000, 10000, "あたしたちはまだ\n止まらねえぜ！");
INSERT INTO `v1_5d01802fa390e445fe1d6f48ca614dd096e6b012cf502c1259d5b9295d15a842` VALUES (3, 5, "vo_minigame_1013_icon_2_005_002", 3, "まだまだ行きます\nついてきなさい", 2, "vo_minigame_1013_icon_1_005_002", 3000, 10000, "見てろよ！\nマコト班の快進撃だ！");
INSERT INTO `v1_5d01802fa390e445fe1d6f48ca614dd096e6b012cf502c1259d5b9295d15a842` VALUES (3, 6, "vo_minigame_1013_icon_2_005_003", 3, "エリコ班の\n本領発揮ですわ！", 2, "vo_minigame_1013_icon_1_005_003", 3000, 10000, "うおぉぉっ！\n絶好調だぜ！");
INSERT INTO `v1_5d01802fa390e445fe1d6f48ca614dd096e6b012cf502c1259d5b9295d15a842` VALUES (3, 7, "vo_minigame_1013_icon_2_006_001", 4, "ここからは\n前人未到の領域です！", 2, "vo_minigame_1013_icon_1_006_001", 3000, 0, "どこまで行けるか\n楽しみだなっ！");
INSERT INTO `v1_5d01802fa390e445fe1d6f48ca614dd096e6b012cf502c1259d5b9295d15a842` VALUES (4, 8, "vo_minigame_1013_icon_2_007_001", 5, "厄介でしたわ…", 3, "vo_minigame_1013_icon_1_007_001", 1000, 1, "まだ諦めんなよっ");
INSERT INTO `v1_5d01802fa390e445fe1d6f48ca614dd096e6b012cf502c1259d5b9295d15a842` VALUES (4, 9, "vo_minigame_1013_icon_2_007_002", 5, "油断大敵です", 3, "vo_minigame_1013_icon_1_007_002", 1000, 1, "冷やっとしたぜ…！");
INSERT INTO `v1_5d01802fa390e445fe1d6f48ca614dd096e6b012cf502c1259d5b9295d15a842` VALUES (4, 10, "vo_minigame_1013_icon_2_007_003", 5, "忌々しいっ…", 3, "vo_minigame_1013_icon_1_007_003", 1000, 1, "弱音を吐くなっ");
INSERT INTO `v1_5d01802fa390e445fe1d6f48ca614dd096e6b012cf502c1259d5b9295d15a842` VALUES (3, 11, "vo_minigame_1013_icon_2_008_001", 6, "大所帯ですわね", 4, "vo_minigame_1013_icon_1_008_001", 1500, 99, "マコト班集合！");
INSERT INTO `v1_5d01802fa390e445fe1d6f48ca614dd096e6b012cf502c1259d5b9295d15a842` VALUES (3, 12, "vo_minigame_1013_icon_2_008_002", 6, "エリコ班へようこそ", 4, "vo_minigame_1013_icon_1_008_002", 1500, 99, "連携してくぞ！");
INSERT INTO `v1_5d01802fa390e445fe1d6f48ca614dd096e6b012cf502c1259d5b9295d15a842` VALUES (6, 13, "vo_minigame_1013_icon_2_020_001", 8, "ナナカちゃんに\nお任せあれ", 1, "vo_minigame_1013_icon_1_020_001", 3000, 0, "みんなに力を！");
INSERT INTO `v1_5d01802fa390e445fe1d6f48ca614dd096e6b012cf502c1259d5b9295d15a842` VALUES (7, 14, "vo_minigame_1013_icon_2_022_001", 9, "はっはっは！\n任せろ！", 1, "vo_minigame_1013_icon_1_022_001", 3000, 0, "任せてくれたまえ");
INSERT INTO `v1_5d01802fa390e445fe1d6f48ca614dd096e6b012cf502c1259d5b9295d15a842` VALUES (8, 15, "vo_minigame_1013_icon_2_023_001", 10, "どんどんいくわよ", 1, "vo_minigame_1013_icon_1_023_001", 3000, 0, "ほな、いきまひょか");
